"original": |2-
     This attribute specifies a priority for scheduling the Job.  A higher
     value specifies a higher priority.  The value 1 indicates the lowest
     possible priority.  The value 100 indicates the highest possible
     priority.  Among those Jobs that are ready to print, a Printer MUST
     print all Jobs with a priority value of n before printing those with
     a priority value of n - 1 for all n.
"fixed": |-
  This attribute specifies a priority for scheduling the Job.  A higher value specifies a higher priority.  The value 1 indicates the lowest possible priority.  The value 100 indicates the highest possible priority.  Among those Jobs that are ready to print, a Printer MUST print all Jobs with a priority value of n before printing those with a priority value of n - 1 for all n.
"ko": |-
  이 속성은 작업 예약의 우선순위를 지정합니다. 값이 높을수록 우선순위가 높아집니다. 값 1은 가능한 가장 낮은 우선순위를 나타냅니다. 값 100은 가능한 가장 높은 우선순위를 나타냅니다. 인쇄할 준비가 된 작업 중에서 프린터는 모든 n에 대해 우선순위 값이 n - 1인 작업을 인쇄하기 전에 우선순위 값이 n인 모든 작업을 인쇄해야 합니다.
